(7, 'CSS', 50, 5, 'Bashar al ali', 'CSS is the acronym of “Cascading Style Sheets”.  CSS is a computer language for laying out and structuring web pages (HTML or XML).  This language contains coding elements and is composed of these “cascading style sheets” which are equally called CSS files (.css).', 'WEB'),
(8, 'JAVASCRIPT', 200, 30, 'Adham Aljawad', 'JavaScript is a scripting or programming language that allows you to implement complex features on web pages — every time a web page does more than just sit there and display static information for you to look at — displaying timely content updates, interactive maps, animated 2D/3D graphics, scrolling video jukeboxes, etc', 'WEB'),
(9, 'Programing with C++', 1000, 20, 'Anas Kilani', 'C++ is an object-oriented programming (OOP) language that is viewed by many as the best language for creating large-scale applications. C++ is a superset of the C language. A related programming language, Java, is based on C++ but optimized for the distribution of program objects in a network such as the internet', 'C'),
(10, 'Programing with C#', 700, 20, 'Anas Kilani', 'C# (pronounced \"See Sharp\") is a modern, object-oriented, and type-safe programming language. C# enables developers to build many types of secure and robust applications that run in .NET. C# has its roots in the C family of languages and will be immediately familiar to C, C++, Java, and JavaScript programmers', 'C'),
(11, 'Photoshop', 600, 10, 'Adham Aljawad', ' Photoshop is an image creation, graphic design and photo editing software developed by Adobe. The software provides many image editing features for pixel-based images, raster graphics and vector graphics', 'DESIGN'),
(12, 'illustrator', 400, 5, 'Bashar al ali', ' Adobe Illustrator is a professional vector-based design and drawing program. Used as part of a larger design workflow, Illustrator allows for the creation of everything from single design elements to entire compositions. Designers use Illustrator to create posters, symbols, logos, patterns, icons, etc', 'DESIGN'),
(13, 'Programing with C', 1500, 20, 'Anas Kilani', ' C is a procedural language that provides no support for objects and classes. C++ is a combination of OOP and procedural programming languages. C has 32 keywords and C++ has 63 keywords. C supports built-in data types, while C++ supports both built-in and user-defined data types', 'C'),
(15, 'Python', 200, 10, 'bashar al ali', ' Python is an interpreted, interactive, object-oriented programming language. It incorporates modules, exceptions, dynamic typing, very high level dynamic data types, and classes. It supports multiple programming paradigms beyond object-oriented programming, such as procedural and functional programming', 'AI');

